import api from "../../services/api";
import { FiHeart, FiBarChart } from "react-icons/fi";

export type CardProps = {
  profile_image?: string;
  nickName: string;
  text_post: string;
  title?: string;
  url_post: string;
  url_img_user?: string;
};

const CardShowContainer: React.FC<CardProps> = ({
  nickName,
  profile_image,
