        <S.ContetPostText>
          <S.PostText>
            <p>commodo elit at imperdiet dui accumsan sit amet nulla fmorbi</p>
          </S.PostText>
          <S.LikeButton>
            <S.ButtonLike>
              <FiHeart size={20} />
