            <span>12 Curtidas</span>
            <FiBarChart size={20} />
            <span>Comentarios</span>
          </S.LikeButton>
        </S.ContetPostText>
      </S.Content>
    </S.Wrapper>
  );
};

export default CardShowContainer;
